				 stroke={segments.all[0]&&(segments.all[0].length > strokeLengthLimit )&& strokeColorLong || strokeColorHover} strokeWidth={strokeWidthHover}
 className={"edgeTail EdgeAggregation clickable content"} tabIndex="-1"></path>

